import React, { Component } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import bg1 from "../../../images/bg_1_thumb.jpg";
import bg2 from "../../../images/bg_2_thumb.jpg";
import bg3 from "../../../images/bg_3_thumb.jpg";
import bg4 from "../../../images/bg_4_thumb.jpg";
import bg5 from "../../../images/bg_5_thumb.jpg";
import bg6 from "../../../images/bg_6_thumb.jpg";

export class CustomizeUser extends Component {
  render() {
    return (
      <div>
        <div className='settings-content'>
          <div className='settings-header'>
            <span>
              <Link
                style={removeTextDecoration}
                className='close-settings'
                to='/'
              >
                &times;
              </Link>
            </span>
            <h2>Background</h2>
          </div>
          <div className='settings-body'>
            <input
              type='image'
              src={bg1}
              alt='Submit'
              height='100px'
              width='160px'
            />
            <input
              type='image'
              src={bg2}
              alt='Submit'
              height='100px'
              width='160px'
            />
            <input
              type='image'
              src={bg3}
              alt='Submit'
              height='100px'
              width='160px'
            />
            <input
              type='image'
              src={bg4}
              alt='Submit'
              height='100px'
              width='160px'
            />
            <input
              type='image'
              src={bg5}
              alt='Submit'
              height='100px'
              width='160px'
            />
            <input
              type='image'
              src={bg6}
              alt='Submit'
              height='100px'
              width='160px'
            />
          </div>
          <div className='settings-footer'></div>
        </div>
      </div>
    );
  }
}

const removeTextDecoration = {
  textDecoration: "none"
};

// Property Type Requirement
CustomizeUser.propTypes = {
  //activeUser: PropTypes.func.isRequired
};
export default CustomizeUser;
